const initialState = {
    filteredProducts:[],
    isFreeShipping:true,
    items:[]
};

const productReducer = (state = initialState,action)=> {

    
    console.log('reducer data', action.data);
    console.log('reducer11111 data',{...state});
    console.log('custom data', state.items.length);
    switch(action.type){
        case 'FETCH_PRODUCT': 
            return {
                ...state,
                items:{
                    "id": 1,
                    "sku": 18644119330491312,
                    "title": "Sphynx Tie Dye Grey T-Shirt",
                    "description": "Sphynx Tie Dye Grey",
                    "availableSizes": ["X", "L", "XL", "XXL"],
                    "price": 10,
                    "isFreeShipping": true
                  },
                filteredProducts:action.data
            }
            
          
        default:return state;

    }
}
export default productReducer;
